import { Link } from "react-router-dom";
import './SearchBar.css'
import logo from '../../img/524_supermario.png';
import { Listado } from "../../Redux/actions";
import {connect} from 'react-redux'


const SearchBar = ({juegos, allVideoGamer, dispatch}) =>{
  console.log('esto es lo que me pasa ' +juegos);

  

  const ejemplo = ()=>{
    Listado();
    mapDispatchToProps();
    console.log("Esto es lo del stock " + JSON.stringify(allVideoGamer));
  }  
 
    return(<div className="containersear">
            
            <img className="logo" src={logo} alt="mario bros"/>

            <div className="accesos"> 
            
                                <Link to='/Home'>
                                <button className="botones">Home</button>
                                </Link>
                               
                                <Link to='/Form'>
                                  <button className="botones">Form</button>
                                </Link>
                                <Link to='/About'>
                                <button className="botones">About</button>
                                </Link>

                                <button className="botones" onClick={juegos}>Buscar</button>
                                <button className="botones" onClick={ejemplo}>Otro</button>

                                                     
            </div>
            <div className="ingreso">
                <input type="text" name="search"  className="ingresoinput"/>
            </div>

           

    </div>)
}
const mapStateToProps= (state)=>{
  return {
    allVideoGamer: state.allVideoGamer
  }
  
}
const mapDispatchToProps = (dispatch)=>{
  return {
    Listado: (allVideoGamer)=>{dispatch(Listado(allVideoGamer))}
  }
} 

export default connect(
                        mapStateToProps,
                        mapDispatchToProps
                        )(SearchBar)
